sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {
  const firstEvent = api.data.look_up_events.results.0;
	return firstEvent.map(e => ({
    id: e._row_data.uniqueValue,
    label: e.name.displayValue,
    sublabel: e.description.displayValue
  }));
}
